class MHDSuite:
    def peakmem_run_sim(self):
        self.run_sim()

    def setup(self):
        n = 512
        nt = int(n / 16)
        t_stop = 0.01

        self.params = {
            "physics": {
                "hydro": True,
                "magnetic": True,
            },
            "mesh": {
                "type": "cartesian",
                "resolution": [n, n],
                "box_size": [1.0, 1.0],
            },
            "time": {
                "span": t_stop,
                "num_timesteps": nt,
            },
            "hydro": {
                "eos": {"type": "ideal", "gamma": 5.0 / 3.0},
                "riemann_solver": "hlld",
                "slope_limiting": True,
            },
        }

